syntax = "proto3";
import "CommRanklistRequest.proto";
import "Ranklist.proto";
//生成文件所在包名
option java_package = "com.gejian.pixel.proto";
//生成的java文件名
option java_outer_classname = "CommRanklistResponseProtobuf";

message	CommRanklistResponse  {
		uint32	result = 10;
		CommRanklistRequest	request = 11;
	repeated	Ranklist	ranks = 12;
}